import React from "react"
import Carousel from 'react-spring-3d-carousel';
import { config } from "react-spring";
import YouTube from 'react-youtube';
import { uuid } from 'uuidv4';

import "./VideoController.scss"

export default  function VideoController(){
    const slides = [
        {
            key: 1,
            content: <YouTube videoId="2g811Eo7K8U" opts={`playerVars: 'https://developers.google.com/youtube/player_parameters'`} />
        },
        {
            key: 2,
            content: <YouTube videoId="2g811Eo7K8U" opts={`playerVars: 'https://developers.google.com/youtube/player_parameters'`} />
        },
        {
            key: 3,
            content: <YouTube videoId="2g811Eo7K8U" opts={`playerVars: 'https://www.youtube.com/watch?v=-kzefBmHSU8'`} />
        }

    ];
    return (
        <div style={{ width: "100%", height: "500px", margin: "0 auto" }}>
        <Carousel showNavigation={true}  offsetRadius={5}animationConfig={config.gentle } slides={slides} />
        </div>
    )
}
